import lift from './res/girl-lift.png'
import railing from './res/railing.png'
import sky from './res/sky.png'
import terrace from './res/terrace.jpg'
import './App.css';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import styles from './styles.module.css'

function App() {
  <div >
    <Parallax pages={2} style={{ top: '0', left: '0' }} class="animation">
      <ParallaxLayer offset={0} speed={0.25}>
        <div class="animation_layer parallax" id="terrace"></div>
      </ParallaxLayer>
      <ParallaxLayer offset={0} speed={0.35}>
        <div class="animation_layer parallax" id="lift"></div>
      </ParallaxLayer>
      <ParallaxLayer offset={1} speed={0.25}> 
      <p> "Hi mom"</p>
      </ParallaxLayer>
    </Parallax>
  </div>
}


export default App;




